import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";


import Input from "../../shared/components/FormElements/Input";
import Button from "../../shared/components/FormElements/Button";
import Card from "../../shared/components/UIElements/Card";
import {VALIDATOR_REQUIRE, VALIDATOR_MINLENGTH} from '../../shared/util/validators';
import { useForm } from '../../shared/hooks/form-hook';
import './PlaceForm.css';

const DUMMY_PLACES = [
    {
        id: 'p1',
        title: '엠파이어 스테이트 빌딩',
        description : '세계에서 가장 유명한 고층 빌딩 중 하나',
        imageUrl : 'https://i.namu.wiki/i/LWDmxnNre1ywCgFNxsnAYqifIUBK6QV653l7CQG-LESmXwPZoGgYgSx5rkgmYlxhDtrom982gM1nnPyjl52hcKHD6hlFjWCVjBVuA4ZbWZN9_utzIzlfsl-sN4HtI7UthpmiWdVVpnTe5vKxOrqCVIczuvRD_in2YZYonx5ZikE.webp',
        address : '20 W 34th St., New York, NY 10001',
        location : {
            lat: 40.7484405,
            lng: -73.9882393
        },
        creator : 'u1'
    },
    {
        id: 'p2',
        title: '나고야 성',
        description : '도쿠가와 이에야스에 의해 건축된 나고야 성',
        imageUrl : 'data:image/jpeg;base64,',
        address : '1-1 Honmaru, Naka Ward, Nagoya, Aichi 460-0031 일본',
        location : {
            lat: 35.18498,
            lng: 136.89965
        },
        creator : 'u1'
    }
    
]

const UpdatePlace = () => {

    const [isLoading, setIsLoading] = useState(true);

    const placeId = useParams().placeId;
    
    
    
    const [formState, inputHandler, setFormData] = useForm({
        title: {
            value : '',
            isValid: false
        },
        description: {
            value : '',
            isValid: false
        }
    }, 
    false
);

    const identfiedPlace = DUMMY_PLACES.find(p => p.id === placeId)

    useEffect(() => {
        if(identfiedPlace){
            setFormData({
                title: {
                    value : identfiedPlace.title,
                    isValid: true
                },
                description: {
                    value : identfiedPlace.description,
                    isValid: true
                }
            }, 
            true
        );
        }
        
    setIsLoading(false)
    }, [setFormData, identfiedPlace])
    

    const placeUpdateHandler = event => {
        event.preventDefault();
        console.log(formState.inputs)
    }
    
    if(!identfiedPlace){
        
        return ( <div className="center">
            <Card>
                <h2>장소를 찾을 수 없습니다.....</h2>
            </Card>
            
        </div>
        )
    }

    if(isLoading) {
        return ( 
        <div className="center">
            <h2>Loading....</h2>
        </div>
        );
    }

    return (
        formState.inputs.title.value &&  
    <form className="place-form" onSubmit={placeUpdateHandler}>
        <Input id="title" 
        element="input" 
        type="text" 
        label="title"
        validators={[VALIDATOR_REQUIRE()]}
        errorText="제목을 입력해주세요."
        onInput={inputHandler}
        initialValue={formState.inputs.title.value}
        initialValid={formState.inputs.title.isValid}
        />
        <Input id="description" 
        element="textarea" 
        label="Description"
        validators={[VALIDATOR_MINLENGTH(5)]}
        errorText="설명을 입력하세요..(최소5글자)"
        onInput={inputHandler}
        initialValue={formState.inputs.description.value}
        initialValid={formState.inputs.description.isValid}
        />
        <Button type="submit" disabled={!formState.isValid}>수정하기</Button>
    </form>
        
    )
}

export default UpdatePlace;